import { Profile } from "./Profile/Profile";
import user from "../assets/user.json";

export const App = () => {
  return (
    <>
      {/* <Profile user={user} /> */}
      <Profile
  username={user.username}
  tag={user.tag}
  location={user.location}
  avatar={user.avatar}
  stats={user.stats}
/>
    </>
  );
};
